import configConstants from '@config/constants'

const {
  API: { baseURL, timeout }
} = configConstants

const fff = { name: 'Divine', age: '29', occupation: 'Software Engineer' }
const bbb = { ...fff, age: 28 }
const hhh = Object.entries(fff)
  .map((arr) => `${arr[0]}=${arr[1]}`)
  .toString()
  .replaceAll(',', '&')

const buuks = 'hello'

console.log('buukss', bbb)

export default buuks
